import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import WelcomePage from './components/WelcomePage.vue';
import UserLogin from './components/UserLogin.vue';
import MainView from './components/MainView.vue';
import AddGraduate from './components/AddGraduate.vue';
import ConsultGraduate from './components/ConsultGraduate.vue';

Vue.config.productionTip = false;

Vue.use(VueRouter);

const routes = [
  { path: '/', component: WelcomePage },
  { path: '/login', component: UserLogin },
  { 
    path: '/main', 
    component: MainView,
    children: [
      { path: 'agregar', component: AddGraduate },
      { path: 'consultar', component: ConsultGraduate },
      { path: 'editar', component: () => import('./components/SearchEdit.vue') }, // Añadir la ruta de edición
      { path: 'direccion-decano', component: () => import('./components/DirDec.vue') } // Añadir la ruta de DIR_DEC
      // Añade más rutas hijas según sea necesario
    ]
  }
];

const router = new VueRouter({
  routes
});

new Vue({
  render: h => h(App),
  router
}).$mount('#app');
